import React, { Component } from 'react'
import logo from "../../assets/images/logo.png";
import shoppingCart from "../../assets/images/shopping-cart.png";
import { Link } from 'react-router-dom';
export default class Header extends Component {
    render() {

        const navigationItem = [

            { name: "Women", to: "category/women" },
            { name: "Men", to: "category/men" },
            { name: "Kids", to: "category/kids" },

        ]
        const param = window.location.pathname.split("/")[2];
        console.log(param)

        return (
            <header>
                <nav className="navbar navbar-expand-lg ">
                    <div className="container">


                        <div className="collapse navbar-collapse d-flex justify-content-between" id="navbarNav">




                            <ul className="navbar-nav d-flex align-items-center">
                                {navigationItem.map((item) => (<li className={param == item.name ? "nav-item " : "nav-item active"}>
                                    <Link className="nav-link active" aria-current="page" to={item.to}>{item.name}</Link>
                                </li>))}





                            </ul>

                            <span>
                                <a className="navbar-brand" href="#">
                                    <img src={logo} alt='logo' />


                                </a>

                            </span>
                            <div className='shoppingCart'><button className='btn'>
                                <img src={shoppingCart} alt='shopping cart' className='' />

                            </button></div>

                        </div>

                    </div>
                </nav>


            </header>
        )
    }
}
